import React from 'react';

function Result({ results }) {
  return results.map(result => {
    return (
      <div className='result-div'>
        {/* <img src={result?.Poster} alt='' /> */}
        <h3>{result.Title}</h3>
      </div>
    );
  });
}

export default Result;
